<script type="text/javascript">
  $(function () {
    $(window).scroll(function () {
      var sidebar = $('#sidebar-content')
      var length = sidebar.height() - $('.content-spacer').height() + sidebar.offset().top
      var scroll = $(this).scrollTop()
      var height = $('.content-spacer').height() + 'px'

      if (scroll < sidebar.offset().top) {
        $('.content-spacer').css({
          'position': 'absolute',
          'top': '0'
        })
      } else if (scroll > length) {
        $('.content-spacer').css({
          'position': 'absolute',
          'bottom': '0',
          'top': 'auto'
        })
      } else {
        $('.content-spacer').css({
          'position': 'fixed',
          'top': '10px',
          'height': height
        })
      }
    })
  })
</script>
